(1, 1, 1, 'MDP Level 1', 'MDP Level 1\r\n\r\n*  Brings delegates to GSM Level ', '*  Must be a green performer for 4 out of the past 6 months\r\n*  Must have an NPS score been above 62% for 2 out of the past 3 months\r\n*  Must **not** have had any written complaints against them in the past 6 months\r\n*  Must be part of your ARDs regional succession plans\r\n*  Must **not** have any live disciplinary sanctions', 1, 0, 1, 'Kingsley Raspe', '07961232123', 'Kingsley.Raspe@Phones4u.co.uk', 1),
(2, 1, 1, 'MDP Level 2', 'MDP Level 2 Example Description', '', 1, 1, 1, 'Kingsley Raspe', '0796123129123', 'Kingsley.Raspe@Phones4u.co.uk', 2),
(3, 2, 2, 'Presenting with Edge', 'The HOW to getting a WOW when presenting to any audience.This one day workshop will provide you with the tools and techniques to engage and connect with your audience; whilst leaving them clear on your message.By the end of this workshop you''ll be able to:*  Recognise the key areas of presenting*  Explain how to engage with any audience*  Demonstrate how to tell ''your story'' for maximum impactThis workshop is ideal for:*  People who present to groups *  People who present to senior stakeholders*  People who manage others and deliver team briefs / communications*  People looking to develop their ''presenting edge''', '# Must be awesome', 0, 0, 1, 'Kingsley Raspe', '07932139123', 'Kingsley.Raspe@Phones4u.co.uk', 1),
(4, 2, 2, 'You and Your Brand', 'Develop confidence from within and receive expert advice from a style consultant.\r\nThis one day workshop will help you to unlock your confidence, whilst providing you with the tools to enhance your own Brand.\r\n\r\nBy the end of this workshop you''ll be able to:\r\n\r\n*  Recognise the areas within your control where you can develop your confidence\r\n*  Understand the importance of your Brand and the impact you''re having\r\n*  Explain how to use the tools to enhance your Brand\r\n\r\nThis workshop is ideal for:\r\n\r\n*  People who are looking to develop their confidence \r\n*  People who present to others in meetings\r\n*  People who are looking to develop as managers', '', 0, 1, 1, 'Kingsley Raspe', '07932139123', 'Kingsley.Raspe@Phones4u.co.uk', 2),
(5, 2, 2, 'Innovation and creativity', 'Different thinking = different results.\n\nThis one day workshop will give you an opportunity to think ''outside of the box'' and provide you with the tools to be more innovative and creative in your role.\n\nBy the end of this workshop you''ll be able to:\n\n*  Understand your own thinking types\r*  Apply a range of creativity techniques to problems & challenges\r*  Demonstrate practical problem solving and idea generation\r\rThis workshop is ideal for:\n\n*  People who are looking for creative tools to support them in their role\r*  People who want to understand how to generate more ideas from their teams\r*  People looking to develop their skills and add to their knowledge\r', '', 0, 0, 1, 'Kingsley Raspe', '07932139123', 'Kingsley.Raspe@Phones4u.co.uk', 3),
(6, 2, 5, 'Test', 'Test', 'Test', 0, 1, 1, '', '', '', 0),
(7, 2, 6, 'RnD', '# RnD Christmas Party\r\n\r\nWant to party with the RnD crew? Book here!', '', 0, 0, 1, 'Kingsley Raspe', '01782713213', 'Kingsley.Raspe@Phones4u.co.uk', 1),
(8, 3, 6, 'Compliance', '', '', 0, 0, 1, '', '', '', 99),
(9, 3, 6, 'Central Ops', '', '', 0, 0, 1, '', '', '', NULL);
